import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";

let createNote = (noteItem) => 
    <Note 
        key={noteItem.key}
        title={noteItem.tile}
        content={noteItem.content}
    />



let App = () => 
   (
        <div>
            <Header />
            {notes.map(createNote)}
            <Footer />
        </div>
    );


export default App;
